import React, { useEffect } from 'react';
import dynamic from 'next/dynamic';
const yallamma = dynamic(() => import('@alan-ai/alan-sdk-web'), {
  ssr: false
});
const alanBtn = yallamma;



const alanKey = '41451801c5be1cc25d558341b0b04d782e956eca572e1d8b807a3e2338fdd0dc/stage';
const App = () => {
    useEffect(() => {
        alanBtn({
            key: alanKey,
            onCommand: ({ command }) => {
                    alert('This code was executed');
            }
        })
    }, []);
    return (
        <div><h1>Alan AI News Application</h1></div>);
}
export default App;
